By pulling in mdbook as a library, preprocessors can have access to the existing infrastructure for dealing with books. For example, a custom preprocessor could use the CmdPreprocessor::parse_input() function to deserialize the JSON written to stdin. Then each chapter of the Book can be mutated in-place via Book::for_each_mut() , and then written to stdout with the serde_json crate. Chapters can be accessed either directly (by recursively iterating over chapters) or via the Book::for_each_mut() convenience method. The chapter.content is just a string which happens to be markdown. While it's entirely possible to use regular expressions or do a manual find & replace, you'll probably want to process the input into something more computer-friendly. The pulldown-cmark crate implements a production-quality event-based Markdown parser, with the pulldown-cmark-to-cmark allowing you to translate events back into markdown text. The following code block shows how to remove all emphasis from markdown, without accidentally breaking the document. fn remove_emphasis( num_removed_items: &mut usize, chapter: &mut Chapter,
) -> Result<String> { let mut buf = String::with_capacity(chapter.content.len()); let events = Parser::new(&chapter.content).filter(|e| { let should_keep = match *e { Event::Start(Tag::Emphasis) | Event::Start(Tag::Strong) | Event::End(Tag::Emphasis) | Event::End(Tag::Strong) => false, _ => true, }; if !should_keep { *num_removed_items += 1; } should_keep }); cmark(events, &mut buf, None).map(|_| buf).map_err(|err| { Error::from(format!("Markdown serialization failed: {}", err)) })
} For everything else, have a look [at the complete example][example].

