First you'll want to create a new binary program and add mdbook as a dependency. $ cargo new --bin mdbook-wordcount
$ cd mdbook-wordcount
$ cargo add mdbook When our mdbook-wordcount plugin is invoked, mdbook will send it a JSON version of RenderContext via our plugin's stdin. For convenience, there's a RenderContext::from_json() constructor which will load a RenderContext. This is all the boilerplate necessary for our backend to load the book. // src/main.rs
extern crate mdbook; use std::io;
use mdbook::renderer::RenderContext; fn main() { let mut stdin = io::stdin(); let ctx = RenderContext::from_json(&mut stdin).unwrap();
} Note: The RenderContext contains a version field. This lets backends figure out whether they are compatible with the version of mdbook it's being called by. This version comes directly from the corresponding field in mdbook's Cargo.toml. It is recommended that backends use the semver crate to inspect this field and emit a warning if there may be a compatibility issue.

