Now imagine you don't want to count the number of words on a particular chapter (it might be generated text/code, etc). The canonical way to do this is via the usual book.toml configuration file by adding items to your [output.foo] table. The Config can be treated roughly as a nested hashmap which lets you call methods like get() to access the config's contents, with a get_deserialized() convenience method for retrieving a value and automatically deserializing to some arbitrary type T. To implement this, we'll create our own serializable WordcountConfig struct which will encapsulate all configuration for this backend. First add serde and serde_derive to your Cargo.toml, $ cargo add serde serde_derive And then you can create the config struct, extern crate serde;
#[macro_use]
extern crate serde_derive; ... #[derive(Debug, Default, Serialize, Deserialize)]
#[serde(default, rename_all = "kebab-case")]
pub struct WordcountConfig { pub ignores: Vec<String>,
} Now we just need to deserialize the WordcountConfig from our RenderContext and then add a check to make sure we skip ignored chapters. fn main() { let mut stdin = io::stdin(); let ctx = RenderContext::from_json(&mut stdin).unwrap();
+ let cfg: WordcountConfig = ctx.config
+ .get_deserialized("output.wordcount")
+ .unwrap_or_default(); for item in ctx.book.iter() { if let BookItem::Chapter(ref ch) = *item {
+ if cfg.ignores.contains(&ch.name) {
+ continue;
+ }
+ let num_words = count_words(ch); println!("{}: {}", ch.name, num_words); } } }

