With the following syntax, you can include files into your book: {{#include file.rs}} The path to the file has to be relative from the current source file. mdBook will interpret included files as markdown. Since the include command is usually used for inserting code snippets and examples, you will often wrap the command with ``` to display the file contents without interpretting them. ```
